import { Component, Input } from '@angular/core';

@Component({
  selector: 'app-breed',
  templateUrl: './breed.component.html',
  styleUrls: ['./breed.component.scss']
})

export class BreedComponent {
  @Input() breed: any;
}
<mat-card>
  <mat-card-header>
    <mat-card-title>{{breed.breed}}</mat-card-title>
    <mat-card-subtitle>{{breed.country}}</mat-card-subtitle>
  </mat-card-header>
  <mat-card-content>
    <p>This card indeterminates progress bar.</p>
  </mat-card-content>
  <mat-card-actions>
    <button mat-button>LIKE</button>
    <button mat-button>SHARE</button>
  </mat-card-actions>
</mat-card>
